INSERT INTO `shetuan` VALUES ('00000001', '河南大学学生社团联合会', '河南大学学生社团联合会是在中共河南大学委员会的领导下和共青团河南大学委员会的具体指导下管理、服务、指导、监督河南大学各学生社团的学生自治组织，是建设校园精神文明、发展先进文化的重要力量。\r\n\r\n\r\n河南大学学生社团联合会设有八部一室，分别为：办公室、外联部、组织部、纪检部、策划部、宣传部、网络部、新闻编辑部和文艺部。\r\n\n办公室:\r\n办公室是社联的重要组成部分,在社联中起枢纽的作用,被形象地称为社联的“管家”。主要负责社联的内部财务与文件档案等事务，在具体活动中负责执行协调工作，在日常工作中负责协调社联各部门和社团的正常运转。\r\n\n外联部:\r\n负责争取社会各方面的支持，寻求商家的赞助合作，以及组织和\r协调各社团的实践活动等。\r\n\n组织部:\r\n作为社联重要部门的组织部,主要负责社团的成立、注销的审查，主席团日常文秘起草，社联大型活动如社团十大人物，社团巡礼，社团文化节，学年表彰文件的制定以及社联委员、社团干部培训工作，并组织开展思想教育活动。\r\n\n纪检部:\r\n负责社联内部各项活动的考勤和各社团活动的打分监督，保证学\r生社团健康有序的开展活动，负责评定“星级学生社团”、“优秀学\r生社团”、“学生社团优秀干部”等评优工作。\r\n\n策划部:\r\n策划部是社联的“智囊”,它负责各项工作与活动的策划，协助学生社团活动的整体策划安排。积极开展并推动整个学生社团之间的经验交流，审核社团活动策划方案。\r\n\n宣传部:\r\n宣传部作为社联的“形象大使”,主要负责社联的各项日常宣传\r工作，承接展板、海报设计以及活动摄影工作。  \n \r\n网络部\r\n通过网络开展并推动各学生社团之间的交流，负责社联网站的日\r常更新和管理工作，及时发布社联、社团动态，策划执行每年一届的\r电子竞技大赛。\n\r\n新闻编辑部\r\n负责社联及社团大小活动的新闻采写，及时发布在学校各个媒体，\r记录会议内容并整理存档备查。负责社联杂志的选稿、撰稿、印发及\r管理等。\r\n\n文艺部\r\n负责社联大型文艺活动汇演的前期彩排和现场的幕后工作，是社\r联金牌活动的总策划师。\r\n', '/images/commLogo/shelian.jpg', '999', '1099', '社团管理', '1', '未设置', '河南大学校团委', 'NULL', 'NULL', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000002', '明德廉风学社', null, '/images/commLogo/none.png', '42', '1', '思想政治', '0', '未设置', '哲学与公共管理学院', 'NULL', '河南大学12•9廉洁教育系列活动月', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000003', '中国特色社会主义研究会', '中国特色社会主义研究会成立于2015年，挂靠在河南大学马克思主义学院，现任指导老师马润成，彭绪琴，张兴茂，现有会员人数184人。我们成立中国特色社会主义研究会，一方面是为了使大学生真正将中国特色社会主义道路、理论、制度内化于心，外化于形；另一方面也是为了提高大学生的综合素质，使之成为可以不断学习、自我革新、正确思考的“可持续发展”人才，让人生更出彩！我们协会主要通过研读经典、培训、宣传、热点追踪、专题讲座、课题研究、理论知识竞赛、社会调查、模拟活动、主题研讨会等形式，使大学生全面深入的掌握马克思主义的精神实质和党的路线方针政策，理性而准确的认识国史和国情，培养出有政治素养、有责任、有使命的大学生！', '/images/commLogo/none.png', '184', '6', '思想政治', '1', '未设置', '河南大学马克思主义学院', 'NULL', '读书日活动', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000004', '马克思主义研究会', '河南大学马克思主义研究会成立于1989年6月，挂靠于文学院。它是全校学生积极参与的，也是我校成立最早的学生理论社团，以“宣传马克思主义、坚定理想信念、追求真理、探索人生道路”为宗旨。二十多年来，随着学校的发展，马克思主义研究会也从稚嫩走向成熟，多次被评为河南大学“马列先进集体”、“十佳社团”、“五星级社团”，是我校“学习邓小平理论‘1+1+1’教学模式实验班”；2003年，被省教育厅评为“河南省教育系统优秀社团”； 2009年4月1号，在河南大学视察的国家领导人习近平应邀参加马克思主义研究会开展的主题为“知行合一，报效祖国”的研讨会，并给予极高评价；2010年被中国共产主义青年团中央委员会评为“大学生思想引导优秀活动案例”。2013年1月，马克思主义研究会举办的“时政沙龙”系列活动，被河南省教育厅、河南省高工委授予“2012年度河南省高等学校思想政治工作优秀品牌”的荣誉称号。', '/images/commLogo/1537265787018logo.png', '78', '9', '思想政治', '1', '17334819690', '河南大学文学院', '张嵘森', '主题征文、时政沙龙、专家讲座、社会实践、新闻评选、思想交流会、两会解读', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000005', '河南大学国学研究会', null, '/images/commLogo/none.png', '500', '1', '学术科技', '0', '未设置', '河南大学黄河文明与可持续发展研究中心', 'NULL', '', 'NULL', '金明');
