INSERT INTO `shetuan` VALUES ('00000007', '书评学社', '河南大学书评学社成立于1984年，隶属于图书馆，是以校图书馆为依附的学生社团组织。她以引导学生多读书、读好书，提高阅读水平为宗旨；以提高社员表达能力、辨意识和知识品格为目的，吸收了历届爱好读书的朋友，举办各种读书写作、讨论活动，并编辑印发了社刊《书苑》。多年来她一直本着务实求真的态度服务于社员，得到了学校有关领导与广大老师，特别是图书馆的关心、支持和帮助。如今，从这个书香缭绕的园地里，已走出了1600余人，包括近百名研究生，并在国家、省市、校级刊物上发表文章三百余篇。协会本着“读书，品书，感悟人生。谈书，交心，以书会友”的宗旨，致力于提高社员表达能力，思辨意识和知识品格。从书中感悟人生，在书林结交挚友，同时尽最大的努力在生活、学习中给予指引和帮助。', '/images/commLogo/1537273976409logo.png', '240', '3', '学术科技', '0', '欢迎加入河大书评2018新生群，群聊号码：826627839', '河南大学图书馆', 'NULL', '书评学社迎新晚会\n国学知识竞赛', 'NULL', '明伦');
