INSERT INTO `shetuan` VALUES ('00000022', '红学研究会', '河南大学红学研究会成立于2010年，挂靠于文学院。自成立以来，以“探古今以求善真，极高明而道中庸”为宗旨，坚持“让每一个会员都有收获”的原则，以《红楼梦》文化为引导，探寻古典文化的魅力，追求古典文化的现代演绎，活跃校园文化。协会除定期组织会员组员的交流外，还在学校开展红楼文化展、红楼电影巡礼、教师讲座、学生讲坛和红楼梦主题晚会等活动，营造了良好的人文氛围。兰亭雅集，岂聚曩时之少长，滕阁制序，还待我辈之新秀；奇文共赏，郑笺同析，百年河大园里，让我们相识相知在追梦的途中……', '/images/commLogo/none.png', '68', '3', '学术科技', '0', '未设置', '河南大学文学院', 'NULL', '视频点播、红学知识讲座', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000023', '三农发展研究会', '三农发展研究会协会会徽以蓝色背景与河大校徽相呼应，两者都是蓝色，其次双手对立罩在三片叶子之上喻有呵护，保护的意思，同时双手也代表着“人”，是对我们人的一种期望，希望作为“人”的我们人去关注三农，为三农做些贡献。手下的三片叶子代表三农（农业，农村，农民）它们三者的颜色都不一样，绿色代表生命，活力，希望，所以它们三个的基色是绿色，但是最上面的那个叶子是黄绿（刚发芽，脆弱）左下深绿色，右下橄榄绿，两者差不多，会有一些小小的差别，2003是社团成立的时间，其中河南大学三农发展研究会几个字顺着圆的形状去写，把农字放中间，河跟会是对齐的。', '/images/commLogo/1537252956597logo.png', '180', '12', '学术科技', '1', '河大三农2018迎新群：829137371\n欢迎关注官方微信：河大三农\n', '河南大学马克思主义学院', 'NULL', '寒暑假下乡活动、周边共建项目活动、支农社团交流会 ', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000024', '国学研究会', '河南大学国学研究会以“为天地立心，为生民立命，为往圣继绝学，为万世开太平”为理念，弘扬国学，传诵经典，继承中华民族的宝贵精神财富。协会以河南大学深厚的历史文化底蕴为依托，传承国学文明、传播先进文化，通过积极正确的途径开展健康向上、丰富多彩的校园文化活动，引起广大学子对国学的关注，并不断学习、了解和领会，从而提高综合素质和能力。解读经典，呼唤中国传统文化精华的回归，让广大学子和社会大众树立起对传统文化的正确认识，以解决现代人生活中的困惑和迷茫，同时不断完善自己的道德体系和价值体系，进而为构建社会主义和谐社会和实现中华民族的伟大复兴贡献力量。', '/images/commLogo/none.png', '58', '5', '学术科技', '0', '未设置', '河南大学教务处', 'NULL', '河南大学名家讲坛、昆曲传唱、座谈会、敦复书院学习', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000025', '就业协会', '河南大学就业协会是在河南大学毕业生就业指导与服务中心的指导下成立的面向大学生、面向用人单位、为学生及用人单位提供优质服务的社团组织。是河南大学众多社团之中最具实力的社团之一，在河南大学多次量化评比中，协会均名列前茅，连续几年都被评为河南大学5星级社团.协会始终以自主、自立、求是、创新为准绳，服务广大同学，提供更多新的就业信息；组织运用科学的理念帮助大学生积极向上，健康成长；组织社会实践活动，提高协会成员的能力，提升整个协会的实力；自发地组织小部分同学进行创业演练为使命！', '/images/commLogo/1537338570269logo.png', '30', '12', '创新创业', '0', '未设置', '河南大学就业指导中心', 'NULL', '迎新晚会、平安果大派送、双选会、招聘会', 'NULL', '明伦');
