INSERT INTO `shetuan` VALUES ('00000031', '实习联盟', '实习联盟成立于2009年，隶属于河南大学历史文化学院团委，现任指导老师谢羽飞，现有会员人数140人。该社团是一个旨在提高大学生实践能力和集志同道合中人，共同谋发展的学生社团，协会现拥有会员四百多人，涵盖河南大学16个特色专业，协会会员还包括开封大学在内的特色专业，是我市会员来自不同学校的学生社团之一。其品牌活动有模拟招聘大赛。', '/images/commLogo/none.png', '140', '6', '创新创业', '0', '会长:张明明（文化产业与旅游管理学院）\nQQ2581166709', '河南大学历史文化学院团委', '张明明，陈玉峰', '模拟招聘大赛', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000032', '模拟联合国协会', '河南大学模拟联合国协会，简称河大模联（HENUMUN），2007年由外语学院付江涛老师创立，是河南大学外语学院下属的学生社团，针对全校各个院系学生开放。河南大学模拟联合国协会主要以自身学术培训和各层次模拟联合国会议和涉外性质的活动给予成员最真实的外交官体验。学生们通过亲身经历联合国会议的流程，熟悉联合国的运作方式，了解世界上的国际大事。模拟联合国的宗旨是让学生了解联合国和国际形势，展现个人能力，培养学生的团队精神，提高其综合能力。通过模拟联合国活动，学生们学习了国际政治知识，熟悉了联合国有关机构的议事规则和运作方式，提高了谈判技巧和外语表达能力，为今后走向社会、走向世界打下基础。从2010年至今，河南大学模拟联合国协会每年都积极选派队伍代表参加全国各高校的模拟联合国大会。在积极外出参加模拟联合国大会的同时，河南大学也积极筹备自己的会议，河南大学模拟联合国大会于每年四月举行。', '/images/commLogo/1537357604441logo.png', '275', '7', '创新创业', '0', '未设置', '河南大学外语学院', 'NULL', '模拟联合国大会', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000033', '摄影协会', null, '/images/commLogo/none.png', '40', '2', '文化体育', '0', '未设置', '国际教育学院', 'NULL', '“ISO杯”摄影比赛', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000034', '触角动漫社', '我社是我省起步最早，规模最大，发展最全面的动漫社之一，旨在为河南大学及开封的ACG爱好者创造一个交流互动的平台。之所以名曰为触角（feeler），是希望大家能够以谦虚的态度，探索的精神去面对这片永远充满未知的广阔世界。曾获chinajoy超级联赛河南赛区第一名、华东北赛区第一名、全国总决赛最佳表演奖。', '/images/commLogo/1537348512706logo.png', '200', '46', '文化体育', '1', '明伦校区社长张源航18539051751\n金明校区社长李梓源15837863205', '河南大学经济学院、河南大学艺术学院', '明伦校区 张源航\n金明校区 李梓源', 'Cosplay演出及舞台剧参赛、触角动漫DANCE大会(周年祭)、漫画教学讲座、化动漫赏析展览（为大家提供机会一同观赏最新动画）、手办模型摄影、电竞大赛、yy歌会、lolita交流茶话会、漫画插画原创交流会等', 'NULL', '明伦');
