INSERT INTO `shetuan` VALUES ('00000037', '书法协会', null, '/images/commLogo/none.png', '200', '1', '文化体育', '0', '未设置', '河南大学环境与规划学院、河南大学历史文化学院团委', 'NULL', '一元义卖春联，书法交流课，”河大杯”书法比赛，书画展', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000038', '阳光长跑协会', '把运动养成习惯，让生命更加精彩！跑步无疑是最简单的锻炼身体的方法，持之以恒，可以达到增强体质的效果，使我们摆脱亚健康状态！为认真贯彻落实全国亿万学生阳光体育运动的实施，河南大学阳光长跑协会在学校校体委和校团委的指导与支持下，于2012年12月19日在河南大学老校区成立，2014年11月10日在新校区成立分会。均挂靠于河南大学公共体育教研部，由河南大学体育运动委员会办公室主任、河南大学公共体育教研部副主任赵克强为指导老师。是一个以长跑训练，运动健身为目的运动类协会！协会提倡创新、坚持、包容、奉献的精神。创新是生存和发展的前提；坚持是长盛不衰的根本；包容是增强团结、凝心力的保证；奉献是服务同学、服务社会的动力。协会现有会员120余人，包括明伦校区70人，金明校区50余人。协会的精品活动包括：“新生杯”环校跑挑战赛、蜗牛户外徒步节、阳光长跑公开赛、组织郑开马拉松河南大学代表团、组织参加开封市元旦越野赛、校园定向越野赛。所办的比赛和活动均得到校领导和全校师生的一致好评，各大媒体纷纷报道比赛和活动讯息。精品活动：“新生杯”环校跑挑战赛、蜗牛户外徒步节、阳光长跑公开赛、组织郑开马拉松河南大学代表团、组织参加开封市元旦越野赛、校园定向越野赛。 ', '/images/commLogo/none.png', '120', '16', '文化体育', '1', '未设置', '河南大学公共体育教研部', 'NULL', '', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000039', '自行车协会', '协会是一个以自行车为载体，举办以自行车比赛、骑车旅行、极限运动和社会服务等为主要内容的学生社团，本着“ 健身、参与、进步、协作”的宗旨，通过各类社会实践活动，使会员达到“锻炼、学习、服务”的目的，培养和增强大学生“坚持、创造、奋进、挑战、超越”的品质。协会下设会长副会长以及办公室，骑行团，新网部，文宣部，策划部，外联部六个部门，自2003年协会成立至今，协会总出行旅程近两万余公里，平均每星期活动高达3次之多。我们用车轮去丈量祖国的土地，北至漠河，西到拉萨，南行海南，东出胶东。河大车协历次活动均有良好的公众反映和社会影响，是河南大学最具影响力学生社团之一，同时也是省内高校学生社团中的佼佼者。', '/images/commLogo/none.png', '200', '3', '文化体育', '0', '未设置', '公共体育教研部', 'NULL', '激情南太行之旅，中原高校单车驿站年会', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000040', '台球协会', '河南大学台球协会成立于2007年，曾连续5年被评为河南大学十佳优秀社团，设有办公室、技术部、女子部等9个部门，定期进行教学活动及各种比赛。随着台球运动在河大校园内的发展壮大，台球协会也渐渐成为了一个大家庭，与数家球房倾力合作，权威的教练指导，共同打造了河南大学人气社团。', '/images/commLogo/none.png', '300', '4', '文化体育', '0', '裴梓良18937831055', '数学与统计学院、河南大学体育学院', '裴梓良', '河南省大学生台球联赛', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000041', '汉服社', '《左传》有云：“中国有礼仪之大，故称夏；有章服之美，谓之华。” 对于华夏民族而言，我们的民族服饰——汉服，不只是一件衣裳，更多的是华夏文明的一个载体，是传统文化的一个重要方面。我们河南大学汉服社作为汉服复兴者的一员愿用一腔热血，社团宗旨是以汉服为载体，复兴传统文化，唤醒民族意识，使我泱泱华夏不再“赤裸”立于世界民族之林。我们始终相信，汉服——终将复兴，而我们只是在汉服复兴路上先行了一步。在此，我们必将尽我们之所能，为汉服之复兴，文化之传承铺路搭桥。华夏复兴，衣冠先行，始于衣冠，达于博远。', '/images/commLogo/1537356878659logo.png', '60', '19', '文化体育', '0', '社长许丹璐Tel:15137130922', '经济学院团委、河南大学历史与文化学院', '社长:许丹璐\n副社:杨奕、王雨琪', '“汉服文化周”、“花朝出行日”、“汉舞、手工制作、射艺等教习”', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000042', '轮滑协会', '河大轮协是由课余爱好轮滑的在校大学生自发组织起来的全校性学生社团。协会以张扬个性，展现青春，挑战自我，为宗旨。采取自愿参加的原则，我们的社员充满激情，是青春的象征，喜欢挑战，热爱运动。协会以提高大学生身体素质，丰富大学生课余生活为目标，为轮滑爱好者提供交流平台，推广轮滑运动。同时促进我校社团文化的发展，提高河南大学知名度。', '/images/commLogo/none.png', '60', '11', '文化体育', '0', '未设置', '河南大学公共体育部', 'NULL', '', 'NULL', '明伦');
