INSERT INTO `shetuan` VALUES ('00000050', '双截棍协会', '河南大学双节棍协会成立于2008年，简称河大棍协、棍协。是由热爱双节棍运动、发扬李小龙精神的该校学生组成的大学生社团。协会以双节棍练习和节目演出为主，以丰富该校大学生课余生活、培养个人技能为目的，以推动双节棍运动发展、传承中华传统武术精神为宗旨。', '/images/commLogo/1537281232253logo.png', '86', '9', '文化体育', '0', '官方QQ:1633797598', '河南大学数学与统计学院、河南大学校团委社团部', 'NULL', '协会自成立以来取得了一系列成果和荣誉。在河南大学首届“健美操”大赛中，双节棍协会代表河南大学欧亚国际学院参加演出，荣获特等奖；曾应河南大学校团委邀请报名参加“中国梦想秀”选秀活动；曾受邀参与开封电视台的纪录片拍摄；2013年春，美国洛杉矶三月四日管弦乐队来河南大学演出，曾与协会进行友好交流并为协会拍摄宣传短片；2013年秋，协会组织会员参加河南大学历史文化学院素质大赛，双节棍表演《棍舞青春》荣获二等奖，在2014年历史文化学院迎新春暨素质大赛颁奖晚会上获得最佳团体奖。', 'NULL', '明伦');
