INSERT INTO `shetuan` VALUES ('00000070', '辩论协会', '协会通过举办辩论赛、模拟面试大赛以及辩论与口才培训等为主的丰富多彩的活动，旨在为在校大学生搭建一个锻炼口才、提高思辩能力、培养辩论人才、提高河大整体辩论水平的平台，成立至今已组织并参加了多场省级及全国性赛事。其品牌活动有新生杯辩论赛，辩题征集大赛，主题演讲比赛，辩论能力培训会，世界华语辩论锦标赛。目前，辩论协会已经成功开展了郑汴八校联赛、“励峰杯”新生辩论赛，辩论与口才培训等一系列活动，赢得了校内师生的一致好评，并得到了河南农业大学、中原工学院、河南工业大学等兄弟院校的高度评价，多次荣获河大优秀社团，星级社团称号。辩论协会秉承着“我的大学，思辨天下”的口号，传播校园辩论文化，为百年河大作出自己的一份贡献。', '/images/commLogo/1537271722816logo.png', '300', '20', '文化体育', '1', '会长李晓藤：15137836272\n副会长陈俊魁：15093684843\n副会长李文婷：18937851685\n副会长柳靖：15093684883', '河南大学法学院', 'NULL', '辩论赛、模拟面试大赛以及辩论与口才培训', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000071', '和式太极拳协会', '和式太极拳学会成立于2010年，挂靠在河南大学体育学院，现任指导老师，现有会员人数50人。该社团以“加强自身锻炼，提高身体素质”为核心，以“弘扬中华武术，陶冶大学生情操，丰富大学生生活”为宗旨，倡导“健康身体，将抗生活，健康心灵”。和式太极拳习练时以自然为准则，以圆，弧为运动形式，以太极阴阳变化之法，使身体处处分出虚实内外。视练者体质阶段不同，速度可快可慢，但均匀适宜。架势可大可小，以自然舒展为度。整个拳架朴实无华，简洁流畅。河南大学和式太极拳学会是一个冉冉升起的社团新星，凭借其拥有技术及理论优势，借其太极拳这一展现方式，参加了各类活动。', '/images/commLogo/none.png', '5', '1', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000072', '体育新闻社', null, '/images/commLogo/none.png', '26', '0', '文化体育', '0', '未设置', '公共体育教研部', 'NULL', '春季校运会报道', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000073', '士兵协会', '社团成立于2016年4月，现有会员人数44人，挂靠于河南大学保卫处。为进一步响应习主席所提出的“军民融合式发展”的国家战略，更好的完成伟大的“中国梦、强军梦”目标，在校园文化繁荣之际，由我校退伍复学老兵、热爱军事、志愿参军报国的学生组成的河南大学大学生士兵协会以符合校规校纪，遵守校团委和校社团联合会的各项章程为原则，以宣传国防知识，搞好学校与驻地部队的友好情谊，提高大学生身体素质和国防意识为目的，同时为丰富同学们课余文化生活，活跃校园文化氛围。以各类与军事有关的活动为载体成立该社团。品牌活动有徒步拉练、进军营、大学入伍政策咨询等。', '/images/commLogo/1537280787175logo.png', '44', '2', '文化体育', '0', '社长QQ：303566190\n社长电话：17637870580 ', '河南大学保卫处', 'NULL', '真人CS ', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000074', '民俗学社', '河南大学民俗学社是由一群热爱探究中国古典文化的爱好者创建的社团，社团现有成员90人，挂靠于河南大学黄河文明与可持续发展研究中心。协会宗旨是“提高当代大学生的民俗文化知识，丰富校园文化建设，激发当代大学生深入民间、融入民间，传承民俗文化的兴趣，填补河南大学民俗类社团的空白，为建设和谐校园贡献我们的微博之力。协会重在培养学生的文化素养，综合知识，为广大民俗文化爱好者提供一个可以参与社会实践，体验民间生活，发现自己才华的舞台。', '/images/commLogo/none.png', '90', '5', '文化体育', '0', '未设置', '河南大学黄河文明与可持续发展研究中心', 'NULL', '民俗纪实作品征集大赛，中原民俗文化考察活动 ', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000075', '旅游协会', '河南大学旅游协会成立于2002年，挂靠于河南大学历史文化学院，曾获得“优秀社团”称号。旅游协会是河南大学旅游爱好者组织的全校性非营利性学生社团，是依照规定在河南大学学生社团联合会注册、经校团委审批，并在党委宣传部备案的河南大学学生社团。河南大学旅游协会以“务实、创新、锻炼、发展”为指导思想，以“服务广大会员，普及旅游知识，丰富课余文化生活”为宗旨，争创高起点，高品质，高知名度，高名誉度的一流社团，以其特有的蓬勃朝气和积极向上的气质吸引着一批又一批的旅游爱好者，深受广大师生的好评。', '/images/commLogo/none.png', '115', '9', '文化体育', '0', '未设置', '河南大学历史文化学院', 'NULL', '9.27世界旅游日主题活动', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000076', '粤语爱好者协会', '河南大学粤语爱好者协会创建于2011年，挂靠于历史文化学院，是一个年轻的学生社团，由部分在校粤籍学生和广大粤语爱好者组成。本课程每周开课，利用课堂教学或网络平台进行粤语文化交流。本着“展示南粤文化，弘扬中华魅力”的信念，让有着共同爱好的同学聚到一起，以社团为平台，为大家打开一扇了解南粤文化的窗户，增进不同地域之间的文化交流，相互理解，相互学习。以粤语为桥梁，让大家认识彼此，在这美丽的河大校园内收获美好的人生经历。协会采用正规的粤语教学，定期学习经典的粤语歌曲，组织原声粤语电影交流活动，举办各类趣味活动，致力于让粤语爱好者都能说流利的粤语，唱喜欢的粤语歌，了解粤语地区文化。当然，粤协也还十分的年轻，在未来的发展中会也会有诸多困难，但是，粤协一定会在学校、学院的关怀下努力成长起来，发挥出大学社团服务同学，荣我母校的职责。', '/images/commLogo/none.png', '20', '6', '文化体育', '0', '未设置', '河南大学历史文化学院', 'NULL', '粤语交流课程', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000077', '考古学社 ', null, '/images/commLogo/none.png', '49', '0', '文化体育', '0', '未设置', '河南大学历史与文化学院', 'NULL', '新郑遗址考察', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000078', '天文社', '河南大学天文社成立于2015年，挂靠于欧亚国际学院，现有成员150人。品牌活动有重大天象观测，路边天文学，大型天文学讲座。日常活动主要以天文望远镜相关知识科普、讲解，帮助参与者及时补充天文知识的形式，通过小知识竞赛并附赠小奖励活动让同学直观地学习天文知识，丰富大家的课外知识，调动大众探索宇宙和自然的精神，以及激发大众对天文的积极性，同时，安排观测器材的组装，让天文观测与大众近距离接触。实现趣味、科普、学习、交流的“仰望星空，触碰宇宙”的宗旨。', '/images/commLogo/1537271000129logo.png', '62', '2', '文化体育', '0', '未设置', '河南大学欧亚国际学院', 'NULL', '天文知识竞赛', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000079', '棋类协会', '河南大学棋类协会成立于1997年10 月，挂靠于国际教育学院。棋者，弈也。下棋者，艺也。博弈是东方文化的结晶，至今仍放射出灼灼奇光，影响和陶冶着人们的道德观念、行为准则、审美情趣和思维方式。棋类协会以“以棋会友，丰富生活，共同提高，完善自我“为宗旨，丰富广大同学的业余文化生活，提高同学们的棋艺水平，增进同学们的友谊。协会现设有围棋、中国象棋、五子棋等棋类的活动与安排。所获荣誉：成功举办了 “开封市首届‘移动杯’大中小学生围棋比赛”等多次大型比赛和多次棋类知识讲座。在2001年6月还特聘河南省围棋冠军刘中杰（五段）为协会顾问。2016年成功举办第七届河南省象棋联赛。', '/images/commLogo/1537351575097logo.png', '81', '1', '文化体育', '0', '官Q：3236320493\nQ群：796973413', '河南大学体育学院', '', '棋牌教学、河南省高校联赛               ', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000080', '健美操协会', '健美操协会创办于2001年09月，挂靠于体育学院团委，现发展会员人数311人，其品牌活动有：1.健美操交流会 2.健美操带操健美操是一项深受广大群众喜爱的，普及性极强，集体操，舞蹈，音乐，健身，娱乐于一体的体育项目。本协会主要以有氧健身健美操为主。健美操协会以是团结健美操爱好者为宗旨，调动一切积极因素，推动全校的健美操运动发展，提高我们学校的健美操水平，从而增强学校全民健身氛围。协会特邀河南大学体育学院副教授刘秋玲老师作为指导，通过开展各种健身操活动，不断挑战新的高度，用顽强、无畏、积极的态度去克服所有的困难，将运动最美好的精神在各个方面展现出来，将动感十足的演出与充满自信的微笑传遍整个河南大学。', '/images/commLogo/none.png', '311', '3', '文化体育', '0', '未设置', '河南大学体育学院团委', 'NULL', '健美操交流会、健美操带操', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000081', '跆拳道协会', '跆拳道协会为广大爱好跆拳道运动的同学们提供一个交流学习的平台。其品牌活动是共同学习跆拳道礼仪知识和战术技术。协会宗旨是开发校园专业技术和场馆资源，推动学校经济发展和体育事业的发展；丰富学生校园文化生活，利用课余时间提高学生的实际工作能力；普及跆拳道，学习跆拳道精神，培养学生特长促进我校学生德智体美全面发展。以健康教育为目的在全校展开普及跆拳道运动，以自我发展为宗旨，为跆拳道项目成为体育学院的特色项目、优秀团体而努力。协会成员多为体育学院在校生，都曾荣获全市全省乃至全国大大小小奖项。', '/images/commLogo/1537278846238logo.png', '68', '10', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '跆拳道礼仪知识和战术技术教学', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000082', '太极拳协会', '河南大学太极拳协会成立才两年时间，是一个非常年轻的社团。社团自成立开始一直以传播中华优良传统文化，提高在校大学生身体健康素质和自身协调性为中心思想，致力于提高在校大学生对于中国传统文化既太极拳及器械的兴趣培养和高质量的传播，并以此为基础进行文化的推陈出新。该社团特色活动有每周六、日进行社团活动，传授各式太极拳及器械，参与每学年的新老校区太极拳教学及比赛，并与省内其他院校太极拳协会联谊，定期举办太极拳文化交流赛事，定期传授中华武术及太极拳的文化历史和由来等。本协会太极种类多样化，太极教学多元化，太极交流深层次化。', '/images/commLogo/none.png', '100', '3', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '太极文化之旅', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000083', '街舞协会', '河南大学街舞协会成立于2013年11月，挂靠在河南大学体育学院，现任指导老师岳山，现有会员人数205人，其社团寄语为：河南大学街协会，我们是一个大家庭，成员要互帮互助，共同努力掀起街舞潮！主要涉及的活动有：舞房训练、“以舞会友”、街舞助阵等。协会宗旨：加强成员们的舞技，“以舞会友”丰富同学们的大学生活，开阔眼界；看到自己与别人的差距，提高自己的街舞水平；为大家提供与人交流的平台，增加阅历，丰富经验 ；扩大同学们的关系网，让人生之路一帆风顺。街舞助阵以“情”牵线，为各社团为学院提供文艺活动，提升各协会之间的“零距离”。', '/images/commLogo/none.png', '205', '16', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '舞种公开课', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000084', '登山户外运动协会', null, '/images/commLogo/none.png', '156', '0', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '高空拓展体验、校园定向越野', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000085', '曳步舞', '河南大学曳步舞社团协会创立于2015年9月10日，挂靠于河南大学体育学院，现任指导老师栗江豪，现有会员人数69人。这是一个热爱生命和生活，富有团队意识的集体。我们通过这个社团能让大家认识曳步舞，学习曳步舞，最后爱上曳步舞这种富有节奏，充满活力的舞蹈，丰富同学们的课余生活，陶冶情操，丰富校园文化建设。 ', '/images/commLogo/none.png', '69', '3', '文化体育', '0', '未设置', '河南大学体育学院', 'NULL', '', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000086', '3C千语时空协会', null, '/images/commLogo/none.png', '52', '0', '文化体育', '0', '未设置', '外语学院', 'NULL', '中原手语交流会', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000087', '铁塔文学社', '河南大学铁塔文学社创立于1983年，同年社刊《铁塔湖》创刊，挂靠于河南大学文学院，现任指导老师王银辉，现有会员人数72人。是河南大学也是河南省创办最早的社团之一，拥有社刊《铁塔湖》和合创期刊《试墨》等刊物。不倦探索,无悔追求,一代代铁塔人用自己的执着与真诚耕耘着文学的土壤,编织着文学的梦想。三十载年华，在学校与广大社员的支持下，铁塔文学社不断努力，不断成长。社团先后得到陈忠实、魏巍、李准、松金伞、陈天然等人的惠泽与指导。社员多次在全国性征文比赛中取得优异成绩，作品遍及《人民日报》、《中国青年报》、《河南日报》、《诗刊》等多家著名刊物。宗旨是帮助河大学子追求文学梦想。', '/images/commLogo/1537276954237logo.png', '72', '1', '文化体育', '0', '社团负责人QQ：1076217334', '河南大学文学院', 'NULL', '读书交流会\n游铁塔', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000088', '羽帆诗社', '羽帆诗社以繁荣诗歌创作，振兴中华诗坛为己任。先后出版《羽帆诗刊》、《黄河风诗刊》，成为当时大学诗歌阵营的一支中坚力量。时至今日，我们仍能看到一代一代的羽帆人为诗歌之不死而作出的努力。从创立至今,许多优秀的校园诗人脱颖而出。现在，我们以社刊《此火》为号，在金属摇晃的今日，在莽莽平原之上，在寂寂黑夜之中，将梦高举。魏巍、田间、臧克家、端木蕻良、周启祥、张俊山、苏文魁、李允久、孔令更、陈峻峰、齐遂林等著名诗人和作家都曾先后出任羽帆诗社顾问。其品牌活动有“但为君兮”情诗大赛，羽帆诗社原创诗剧表演。社团曾多次获得河南大学三星级社团称号。 ', '/images/commLogo/1537273765144logo.png', '100', '2', '文化体育', '0', '15093696347', '河南大学文学院', '赵鹏', '“但为君兮”情诗大赛 羽帆诗社原创诗剧表演 诗歌交流会 诗歌采风', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000089', '大平原文学社', '大平原文学社创立于1986年，挂靠在河南大学文学院，现任指导老师郭伟，现有会员人数60人。是河南大学恢复校名以来最早成立的学生社团之一。大平原的办社宗旨是为广大的文学爱好者提供施展自己的园地，这是一片足够广阔的平原让热爱文学的你在这里驰骋飞扬。“丰富业余生活，提高文学气质修养”的办社初衷以各种形式开展活动尽力为大家服务，定期请文学院的名教授举行文学讲座，各式的活动都只为大家求索文学真谛的翻山路，渡河桥，唯愿大家能从中汲取营养，获得动力。文学社自成立以来，本着“以文会友，共写青春”的理念，培养了一大批文学爱好者，人才辈出。', '/images/commLogo/1537271081472logo.png', '60', '2', '文化体育', '0', '大平原官Q :2422532182 ', '河南大学文学院', '社长 李若衡\n副社 袁泽斌 汤梦瑶', '主题征文比赛、读书交流会、外出采风', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000090', '影视协会', '影视协会在十余年间的探索和改革中，也形成了一系列的品牌活动，如：周末校园电影院线、河南大学影视配音大赛、河南大学校园微电影剧本征集大赛、个人微电影拍摄与制作、FIRST青年电影展河南大学赛区作品选拔与推荐、影视专题讲座及作品展、高端微电影制作团队培养计划。自成立以来，影视协会就以传播优秀影视文化、提高广大同学影视欣赏水平为宗旨，在实践中一步步走向成熟，在河大这个伟大母亲的滋养下，他已经成长为一颗善良的心，光彩夺目。社团的宗旨是：秉承“让光影伴我成长”的理念，以小力推动中国大学生电影文化发展。遵守宪法、法律、法规和校团委、学生社团联合会的规定，遵守社会道德风尚。', '/images/commLogo/none.png', '150', '10', '文化体育', '0', '未设置', '河南大学文学院', 'NULL', '配音大赛、周末影院', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000091', '魔术社', '河南大学魔术社成立于2009年，挂靠于文学院。会员数总计一百余人。魔术社以“丰富校园文化，推广魔术艺术”为宗旨，以“最大可能的培养一批魔术爱好者”为目标，以“跟我一起，创造奇迹”为口号，支撑起一片属于自己的天空。魔术社以魔术教学为特色活动，通过魔术教学，会员可以掌握基本的魔术手法，并加以扩展。会员之间广泛的交流可增加手法的熟练程度。在这里，每个人都身怀绝技，每个地方都是舞台，每位成员都是魔术达人。', '/images/commLogo/1537348960659logo.png', '100', '1', '文化体育', '0', '2018面魔术社迎新qq群:828602932\n魔术社官方qq:2179770944\n魔术社负责人qq:1193091526\n', '河南大学文学院', '文学院 :邵笑弟 杨源\n体育学院:段松岭\n欧亚学院:王旭\n', '1.魔术教学：每周四在综合楼，魔术社都会组织社团一起，学习易上手的魔术，保证每个社员都能有一定的收获。同时，增强社员们之间的交流。\n2.开封高校魔术比赛：河南大学魔术社每年都会和河大民生，黄河水利职业技术学院等高校联合举办魔术比赛，交流切磋魔术技法，促进魔术社发展。', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000092', '河南大学吉他协会', null, '/images/commLogo/none.png', '147', '0', '文化体育', '0', '未设置', '河南大学艺术学院', 'NULL', '河南大学摇滚之夜', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000093', '速写与创作协会', '速写与创作协会素称爱好画画者的居所，以“互进创新”为协会宗旨，以创新协会会员思想为目的，使协会朝着良好的势头发展。本协会涉及素描、POP字体、漫画、手绘插画、模型创作、海报等艺术创作。希望让美术绘画的同学在青春画上一抹靓彩，并让美术绘画挖掘每个同学沉睡的创新潜力，开创自己独特的一面，让自己的内在更加卓越！协会不仅招收艺术学院的会员，还为广大热爱艺术的同学创造一个互相交流与学习的平台，协会积极参与学校的各项活动，以及各类专业比赛，使会员得到更多锻炼和实践的机会。还参与设计河南省开封市清明上河园卡通人物的征集活动。协会在周末常常举行社团内部的文艺比拼，让会员在比拼中得到有效的实际练习，提高艺术创作水平，也会定期展示优秀作品，激发会员的积极性，连续几年被评为三星级社团。', '/images/commLogo/1537284497316logo.png', '135', '5', '文化体育', '0', '兰坚毅:13762549424', '河南大学艺术学院', '兰坚毅', '外出采风，手绘活动，手工剪纸，人偶制作活动等等', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000094', '歌手俱乐部', '河南大学歌手俱乐部成立于2008年，挂靠于河南大学艺术学院，现有会员人数40人。该社团是一个专业性演出团体。宗旨是为每一个歌唱爱好者提供交流和自我展现的平台。活跃校园文化氛围，培养和提高同学们的音乐素质，交流飙歌经验、歌唱心得, 推广翻唱音乐，分享音乐乐趣，举行歌友交流会、专业教师辅导等活动，增进会员交流，竭力推动歌唱事业、高品位艺术的发展。歌手俱乐部为同学们提供了一个展示自己、为自己的音乐梦想而去大胆追求的一个舞台，开心快乐的唱出你我的心声。', '/images/commLogo/1537363231503logo.png', '40', '5', '文化体育', '0', '部长:15194645099(余聪)\n副部长:15930520668(张梓峰)\n             18236581017(户文轩)', '河南大学艺术学院', '部长:余聪\n副部长:户文轩   张梓峰   周顺航', '歌友交流会	', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000095', '主持人协会', '主持人协会于2007年成立，挂靠在河南大学新闻与传播学院，现有会员二十余人。协会的主要工作是为各社团、学院以及学校各类活动提供主持人，其品牌活动有主持人大赛。从2007年创办至今，协会走出了许多优秀的主持人，他们活跃在学内、校外的各个角落，为河南大学这座古老的校园增添了亮丽的色彩、注入了新鲜的血液。协会里许多优秀的人才活跃在省级电视台，如河南八套的闻祥、马慧等。', '/images/commLogo/none.png', '26', '3', '文化体育', '0', '2018迎新QQ群 828548646', '河南大学艺术学院', '周继远', '主持人大赛', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000096', '古琴社', null, '/images/commLogo/none.png', '35', '0', '文化体育', '0', '未设置', '河南大学艺术学院', 'NULL', '中国传统化古典文化鉴赏、书法古琴服饰展', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000097', '创意美协', '为更加直接地体验到中华传统手工艺品的魅力，感受传统文化的伟大精髓，创意美协应运而生。创意美协协会是由一群热爱手工艺，崇尚自由、质朴、纯真和自然的成员组成，这里有热爱手工，喜爱创造的小伙伴。协会主要以创作和制作自身爱好或符合大众需求的物件为主，把普通物品以美的形式呈现给大众。创意美协坚持“手作”，坚持自己的“腔调”。协会将大力弘扬中华民族传统工艺，使同学们建立自强不息的生活态度，在生活中发现和创造美，实现自我价值和社会价值。', '/images/commLogo/1537348424503logo.png', '42', '6', '文化体育', '0', '未设置', '河南大学艺术学院', 'NULL', '', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000098', 'NGU演讲与表达协会', 'NGU演讲表达协会创立于2014年，挂靠在河南大学音乐学院，现有会员人数65人。该社团的使命是帮助更多的大学生在众人面前自由表达思想。价值观是乐观；言行一致；永不放弃。他们注重通过一系列的演讲表达训练和实战使更多的大学生具备这项在以后的生活或就业中非常重要的能力。其品牌活动有新生杯演讲比赛、演讲特训营、五四演讲比赛等。', '/images/commLogo/1537253013815logo.png', '65', '35', '文化体育', '1', '官方qq:3126468571', '河南大学公共体育教研部', '杨斌', '五四主题演讲、演讲训练营，新生杯演讲比赛', 'NULL', '明伦');
