INSERT INTO `shetuan` VALUES ('00000108', '留学协会', null, '/images/commLogo/none.png', '6', '0', '志愿公益', '0', '未设置', '河南大学校团委', 'NULL', '', 'NULL', '金明');
INSERT INTO `shetuan` VALUES ('00000109', '爱心俱乐部', '河南大学爱心俱乐部是一个公益性社团，成立于2001年，挂靠在河南大学文学院，现任指导老师周青，现有会员人数100人。其品牌活动有回收军训服，探访儿童村，养老院志愿活动，义卖大河报等。爱心俱乐部是河南大学为数不多的公益社团之一。它以“无私奉献，弘扬正气，提高素质，铸造辉煌”为宗旨，为有责任心、希望为社会增加温暖的学生提供一片天地。爱心俱乐部以其特有的道德、人文内涵和全新的理念在我校社团中独树一帜，为协助促进校园、社会精神文明建设、全方位提高学生的素质做出贡献。十年来，一代代的“爱心人”带着满腔的热情走出校门，迈入社会为其献上自己的一份力。', '/images/commLogo/none.png', '100', '7', '志愿公益', '0', '未设置', '河南大学文学院', 'NULL', '回收军训服，探访儿童村，养老院志愿活动，义卖大河报', 'NULL', '明伦');
INSERT INTO `shetuan` VALUES ('00000110', '法律服务中心', '河南大学法律服务中心品牌活动有12.4“宪法日”，3.15“消费者权益日”，模拟法庭活动，“法条竞赛”活动，案例分析活动，法律援助工作及日常接待咨询工作等。 “以我所学，服务大众”是法律服务中心的宗旨，“给法律学习者以智慧，给法律需求者以帮助”为法服目标。社团自成立以来每年都会举办模拟法庭、法制宣传日等系列活动，受到了社会一致好评。自成立以来社团多次获得河南大学“五星级社团”、“优秀社团”等荣誉称号，2010年我社团被评为河南省高校十大社团标兵，2013年我社团在中国人民大学主办的全国高校法律援助“会见当事人”比赛中获得二等奖，为河南大学赢得了荣誉。', '/images/commLogo/1537253089237logo.png', '40', '6', '自律互助', '1', '未设置', '河南大学法学院', 'NULL', '12.4“宪法日”，3.15“消费者权益日”，模拟法庭活动，“法条竞赛”活动，案例分析活动，法律援助工作及日常接待咨询工作', 'NULL', '明伦');
