INSERT INTO `shetuan` VALUES ('00000123', '英语协会', '河南大学英语协会是由河南大学学生社团联合会、河南大学校团委和河南大学大学外语教研部共同领导下的学生社团组织。本协会按照学校有关社团组织的管理规定开展活动，是以学习为目的的校级学生社团。\r社团名称（全称）：河南大学英语学习协会\r\n成立时间：2002年\r\n挂靠单位：河南大学大学外语教学部\r\n指导老师：蒋框\r\n现任负责人：王贺双\r\n社团宗旨：学习英语从兴趣开始\r\n协会精神:主动、创新、坚持、进取\n河南大学英语协会成立于2002年，是一个为广泛英语爱好者而设的年轻的学习型社团。在其“学习英语从兴趣开始”的口号下，本着“自愿、友谊、提高、进步”的精神信仰，英语协会积极组织一系列活动开拓同学的英语视野，如：唤醒一天学习激情的英语晨读活动、体验教书育人乐趣的外出支教活动、与哑巴英语say goodbye的外教交流活动等。另外，英语协会作为唯一一个隶属于河南大学大学外语教学部的学生社团，多次辅助我校外语教学部的教学活动，开展相关的英语文化讲座，旨在为学生的课余英语学习解疑答惑，构建良好的校园英语学习的互动氛围，进而推动我校学生社团文化的构筑与校园精神文明的建设。\n', '/images/commLogo/1537362825659logo.png', '0', '20', '文化体育', '0', '河南大学英语协会是由河南大学学生社团联合会、河南大学校团委和河南大学大学外语教研部共同领导下的学生社团组织。本协会按照学校有关社团组织的管理规定开展活动，是以学习为目的的校级学生社团。', null, '会长：王贺双', '晨读、外教交流活动、四六级模拟考、日常支教、暑期支教', null, '明伦');
INSERT INTO `shetuan` VALUES ('00000124', '梨园风豫剧社', null, '/images/commLogo/none.png', '0', '0', '文化体育', '0', null, null, 'NULL', null, null, '明伦');
INSERT INTO `shetuan` VALUES ('00000125', '篮球协会', '社团简介:篮球协会是挂靠在河南大学体育学院下的兴趣社团。社团成立的目的在于为热爱篮球的人提供一个交流，训练的平台。给予热衷篮球的成员一个展示自我的机会，让他们在自己所热爱的空间里自由发挥。协会制定协会章程，建立和完善社团自主管理和发展的运行机制，完善协会成员管理考核制度，建立协会评审制度，为协会的发展提供良好的基础和保证。社团成立之后，通过开展形式多样的活动，不仅丰富了同学们的课余生活而且提高了他们的篮球素养。在篮球协会，你可以体验到竞技比赛与游戏的不同滋味;可以结交不同专业，不同年级的朋友;更可以提高篮球的技战术水平。在这里，你能够尽情的展示自己，尽情的享受篮球的魅力。篮球协会热诚欢迎篮球爱好者一同走进“篮球“地带，一同享受运动带给我们的健康和快乐，让我们的活力与激情在这里一起燃烧。\n', '/images/commLogo/1537271374003logo.png', '0', '8', '文化体育', '0', '河南大学篮球协会迎新QQ群:531956770', null, '体育学院 陈硕', null, null, '明伦');
