INSERT INTO `stchange` VALUES ('18', '00000110', '河南大学法律服务中心品牌活动有12.4“宪法日”，3.15“消费者权益日”，模拟法庭活动，“法条竞赛”活动，案例分析活动，法律援助工作及日常接待咨询工作等。 “以我所学，服务大众”是法律服务中心的宗旨，“给法律学习者以智慧，给法律需求者以帮助”为法服目标。社团自成立以来每年都会举办模拟法庭、法制宣传日等系列活动，受到了社会一致好评。自成立以来社团多次获得河南大学“五星级社团”、“优秀社团”等荣誉称号，2010年我社团被评为河南省高校十大社团标兵，2013年我社团在中国人民大学主办的全国高校法律援助“会见当事人”比赛中获得二等奖，为河南大学赢得了荣誉。', '2018-09-18 18:47:07', '2018-09-19 10:24:18', '1', 'brief');
INSERT INTO `stchange` VALUES ('19', '00000078', '河南大学天文社成立于2015年，挂靠于欧亚国际学院，现有成员150人。品牌活动有重大天象观测，路边天文学，大型天文学讲座。日常活动主要以天文望远镜相关知识科普、讲解，帮助参与者及时补充天文知识的形式，通过小知识竞赛并附赠小奖励活动让同学直观地学习天文知识，丰富大家的课外知识，调动大众探索宇宙和自然的精神，以及激发大众对天文的积极性，同时，安排观测器材的组装，让天文观测与大众近距离接触。实现趣味、科普、学习、交流的“仰望星空，触碰宇宙”的宗旨。', '2018-09-18 19:43:34', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('20', '00000089', '大平原文学社创立于1986年，挂靠在河南大学文学院，现任指导老师郭伟，现有会员人数60人。是河南大学恢复校名以来最早成立的学生社团之一。大平原的办社宗旨是为广大的文学爱好者提供施展自己的园地，这是一片足够广阔的平原让热爱文学的你在这里驰骋飞扬。“丰富业余生活，提高文学气质修养”的办社初衷以各种形式开展活动尽力为大家服务，定期请文学院的名教授举行文学讲座，各式的活动都只为大家求索文学真谛的翻山路，渡河桥，唯愿大家能从中汲取营养，获得动力。文学社自成立以来，本着“以文会友，共写青春”的理念，培养了一大批文学爱好者，人才辈出。', '2018-09-18 19:44:55', '2018-09-19 10:24:09', '1', 'brief');
INSERT INTO `stchange` VALUES ('21', '00000089', '主题征文比赛、读书交流会、外出采风', '2018-09-18 19:45:28', '2018-09-19 10:24:04', '1', 'jphd');
