INSERT INTO `stchange` VALUES ('30', '00000070', '协会通过举办辩论赛、模拟面试大赛以及辩论与口才培训等为主的丰富多彩的活动，旨在为在校大学生搭建一个锻炼口才、提高思辩能力、培养辩论人才、提高河大整体辩论水平的平台，成立至今已组织并参加了多场省级及全国性赛事。其品牌活动有新生杯辩论赛，辩题征集大赛，主题演讲比赛，辩论能力培训会，世界华语辩论锦标赛。目前，辩论协会已经成功开展了郑汴八校联赛、“励峰杯”新生辩论赛，辩论与口才培训等一系列活动，赢得了校内师生的一致好评，并得到了河南农业大学、中原工学院、河南工业大学等兄弟院校的高度评价，多次荣获河大优秀社团，星级社团称号。辩论协会秉承着“我的大学，思辨天下”的口号，传播校园辩论文化，为百年河大作出自己的一份贡献。', '2018-09-18 19:58:14', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('31', '00000088', '“但为君兮”情诗大赛 羽帆诗社原创诗剧表演 诗歌交流会 诗歌采风', '2018-09-18 20:30:40', '2018-09-19 20:37:05', '1', 'jphd');
INSERT INTO `stchange` VALUES ('32', '00000088', '羽帆诗社以繁荣诗歌创作，振兴中华诗坛为己任。先后出版《羽帆诗刊》、《黄河风诗刊》，成为当时大学诗歌阵营的一支中坚力量。时至今日，我们仍能看到一代一代的羽帆人为诗歌之不死而作出的努力。从创立至今,许多优秀的校园诗人脱颖而出。现在，我们以社刊《此火》为号，在金属摇晃的今日，在莽莽平原之上，在寂寂黑夜之中，将梦高举。魏巍、田间、臧克家、端木蕻良、周启祥、张俊山、苏文魁、李允久、孔令更、陈峻峰、齐遂林等著名诗人和作家都曾先后出任羽帆诗社顾问。其品牌活动有“但为君兮”情诗大赛，羽帆诗社原创诗剧表演。社团曾多次获得河南大学三星级社团称号。 ', '2018-09-18 20:31:08', '2018-09-19 20:37:20', '1', 'brief');
INSERT INTO `stchange` VALUES ('33', '00000007', '河南大学书评学社成立于1984年，隶属于图书馆，是以校图书馆为依附的学生社团组织。她以引导学生多读书、读好书，提高阅读水平为宗旨；以提高社员表达能力、辨意识和知识品格为目的，吸收了历届爱好读书的朋友，举办各种读书写作、讨论活动，并编辑印发了社刊《书苑》。多年来她一直本着务实求真的态度服务于社员，得到了学校有关领导与广大老师，特别是图书馆的关心、支持和帮助。如今，从这个书香缭绕的园地里，已走出了1600余人，包括近百名研究生，并在国家、省市、校级刊物上发表文章三百余篇。协会本着“读书，品书，感悟人生。谈书，交心，以书会友”的宗旨，致力于提高社员表达能力，思辨意识和知识品格。从书中感悟人生，在书林结交挚友，同时尽最大的努力在生活、学习中给予指引和帮助。', '2018-09-18 20:34:45', '2018-09-19 10:23:45', '1', 'brief');
INSERT INTO `stchange` VALUES ('34', '00000007', '书评学社迎新晚会\n国学知识竞赛', '2018-09-18 20:35:11', '2018-09-19 10:23:50', '1', 'jphd');
INSERT INTO `stchange` VALUES ('35', '00000087', '河南大学铁塔文学社创立于1983年，同年社刊《铁塔湖》创刊，挂靠于河南大学文学院，现任指导老师王银辉，现有会员人数72人。是河南大学也是河南省创办最早的社团之一，拥有社刊《铁塔湖》和合创期刊《试墨》等刊物。不倦探索,无悔追求,一代代铁塔人用自己的执着与真诚耕耘着文学的土壤,编织着文学的梦想。三十载年华，在学校与广大社员的支持下，铁塔文学社不断努力，不断成长。社团先后得到陈忠实、魏巍、李准、松金伞、陈天然等人的惠泽与指导。社员多次在全国性征文比赛中取得优异成绩，作品遍及《人民日报》、《中国青年报》、《河南日报》、《诗刊》等多家著名刊物。宗旨是帮助河大学子追求文学梦想。', '2018-09-18 21:23:22', '2018-09-19 10:23:32', '1', 'brief');
INSERT INTO `stchange` VALUES ('36', '00000087', '读书交流会\n游铁塔', '2018-09-18 21:23:41', '2018-09-19 10:23:28', '1', 'jphd');
INSERT INTO `stchange` VALUES ('37', '00000125', '社团简介:篮球协会是挂靠在河南大学体育学院下的兴趣社团。社团成立的目的在于为热爱篮球的人提供一个交流，训练的平台。给予热衷篮球的成员一个展示自我的机会，让他们在自己所热爱的空间里自由发挥。协会制定协会章程，建立和完善社团自主管理和发展的运行机制，完善协会成员管理考核制度社团简介:篮球协会是挂靠在河南大学体育学院下的兴趣社团。社团成立的目的在于为热爱篮球的人提供一个交流，训练的平台。给予热衷篮球的成员一个展示自我的机会，让他们在自己所热爱的空间里自由发挥。协会制定协会章程，建立和完善社团自主管理和发展的运行机制，完善协会成员管理考核制度，建立协会评审制度，为协会的发展提供良好的基础和保证。社团成立之后，通过开展形式多样的活动，不仅丰富了同学们的课余生活而且提高了他们的篮球素养。在篮球协会，你可以体验到竞技比赛与游戏的不同滋味;可以结交不同专业，不同年级的朋友;更可以提高篮球的技战术水平。在这里，你能够尽情的展示自己，尽情的享受篮球的魅力。篮球协会热诚欢迎篮球爱好者一同走进“篮球“地带，一同享受运动带给我们的健康和快乐，让我们的活力与激情在这里一起燃烧。\n', '2018-09-18 21:30:59', null, '2', 'brief');
