INSERT INTO `stchange` VALUES ('41', '00000125', '社团简介:篮球协会是挂靠在河南大学体育学院下的兴趣社团。社团成立的目的在于为热爱篮球的人提供一个交流，训练的平台。给予热衷篮球的成员一个展示自我的机会，让他们在自己所热爱的空间里自由发挥。协会制定协会章程，建立和完善社团自主管理和发展的运行机制，完善协会成员管理考核制度，建立协会评审制度，为协会的发展提供良好的基础和保证。社团成立之后，通过开展形式多样的活动，不仅丰富了同学们的课余生活而且提高了他们的篮球素养。在篮球协会，你可以体验到竞技比赛与游戏的不同滋味;可以结交不同专业，不同年级的朋友;更可以提高篮球的技战术水平。在这里，你能够尽情的展示自己，尽情的享受篮球的魅力。篮球协会热诚欢迎篮球爱好者一同走进“篮球“地带，一同享受运动带给我们的健康和快乐，让我们的活力与激情在这里一起燃烧。\n', '2018-09-18 21:33:40', '2018-09-19 10:23:14', '1', 'brief');
INSERT INTO `stchange` VALUES ('42', '00000073', '社团成立于2016年4月，现有会员人数44人，挂靠于河南大学保卫处。为进一步响应习主席所提出的“军民融合式发展”的国家战略，更好的完成伟大的“中国梦、强军梦”目标，在校园文化繁荣之际，由我校退伍复学老兵、热爱军事、志愿参军报国的学生组成的河南大学大学生士兵协会以符合校规校纪，遵守校团委和校社团联合会的各项章程为原则，以宣传国防知识，搞好学校与驻地部队的友好情谊，提高大学生身体素质和国防意识为目的，同时为丰富同学们课余文化生活，活跃校园文化氛围。以各类与军事有关的活动为载体成立该社团。品牌活动有徒步拉练、进军营、大学入伍政策咨询等。', '2018-09-18 22:27:10', '2018-09-19 10:24:44', '1', 'brief');
INSERT INTO `stchange` VALUES ('43', '00000050', '河南大学双节棍协会成立于2008年，简称河大棍协、棍协。是由热爱双节棍运动、发扬李小龙精神的该校学生组成的大学生社团。协会以双节棍练习和节目演出为主，以丰富该校大学生课余生活、培养个人技能为目的，以推动双节棍运动发展、传承中华传统武术精神为宗旨。', '2018-09-18 22:51:35', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('44', '00000050', '协会自成立以来取得了一系列成果和荣誉。在河南大学首届“健美操”大赛中，双节棍协会代表河南大学欧亚国际学院参加演出，荣获特等奖；曾应河南大学校团委邀请报名参加“中国梦想秀”选秀活动；曾受邀参与开封电视台的纪录片拍摄；2013年春，美国洛杉矶三月四日管弦乐队来河南大学演出，曾与协会进行友好交流并为协会拍摄宣传短片；2013年秋，协会组织会员参加河南大学历史文化学院素质大赛，双节棍表演《棍舞青春》荣获二等奖，在2014年历史文化学院迎新春暨素质大赛颁奖晚会上获得最佳团体奖。', '2018-09-18 22:52:00', null, '2', 'jphd');
INSERT INTO `stchange` VALUES ('45', '00000050', '河南大学双节棍协会成立于2008年，简称河大棍协、棍协。是由热爱双节棍运动、发扬李小龙精神的该校学生组成的大学生社团。协会以双节棍练习和节目演出为主，以丰富该校大学生课余生活、培养个人技能为目的，以推动双节棍运动发展、传承中华传统武术精神为宗旨', '2018-09-18 22:53:21', null, '2', 'brief');
