INSERT INTO `stchange` VALUES ('51', '00000034', 'Cosplay演出及舞台剧参赛、触角动漫DANCE大会(周年祭)、日语教学讲座、动漫赏析展览（为大家提供机会一同观赏最新动画）、手办模型摄影、电竞大赛、原创漫画插画交流会、yy歌手大赛', '2018-09-19 17:20:12', '2018-09-19 20:37:51', '1', 'jphd');
INSERT INTO `stchange` VALUES ('52', '00000091', '河南大学魔术社成立于2009年，挂靠于文学院。会员数总计一百余人。魔术社以“丰富校园文化，推广魔术艺术”为宗旨，以“最大可能的培养一批魔术爱好者”为目标，以“跟我一起，创造奇迹”为口号，支撑起一片属于自己的天空。魔术社以魔术教学为特色活动，通过魔术教学，会员可以掌握基本的魔术手法，并加以扩展。会员之间广泛的交流可增加手法的熟练程度。在这里，每个人都身怀绝技，每个地方都是舞台，每位成员都是魔术达人。', '2018-09-19 17:23:09', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('53', '00000034', '我社是我省起步最早，规模最大，发展最全面的动漫社之一，旨在为河南大学及开封的ACG爱好者创造一个交流互动的平台。之所以名曰为触角（feeler），是希望大家能够以谦虚的态度，探索的精神去面对这片永远充满未知的广阔世界。曾获得chinajoy超级联赛河南赛区第一名、华东北赛区第一名、全国总决赛最佳表演奖', '2018-09-19 17:24:28', '2018-09-19 20:38:24', '1', 'brief');
