INSERT INTO `stchange` VALUES ('56', '00000125', '社团简介:篮球协会成立于2017年，是挂靠在河南大学体育学院下的兴趣社团。社团成立的目的在于为热爱篮球的人提供一个交流，训练的平台。给予热衷篮球的成员一个展示自我的机会，让他们在自己所热爱的空间里自由发挥。协会制定协会章程，建立和完善社团自主管理和发展的运行机制，完善协会成员管理考核制度，建立协会评审制度，为协会的发展提供良好的基础和保证。社团成立之后，通过开展形式多样的活动，不仅丰富了同学们的课余生活而且提高了他们的篮球素养。在篮球协会，你可以体验到竞技比赛与游戏的不同滋味;可以结交不同专业，不同年级的朋友;更可以提高篮球的技战术水平。在这里，你能够尽情的展示自己，尽情的享受篮球的魅力。篮球协会热诚欢迎篮球爱好者一同走进“篮球“地带，一同享受运动带给我们的健康和快乐，让我们的活力与激情在这里一起燃烧。\n', '2018-09-19 17:41:35', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('57', '00000079', '河南大学棋类协会成立于1997年10 月，挂靠于体育学院。棋者，弈也。下棋者，艺也。博弈是东方文化的结晶，至今仍放射出灼灼奇光，影响和陶冶着人们的道德观念、行为准则、审美情趣和思维方式。棋类协会以“以棋会友，丰富生活，共同提高，完善自我“为宗旨，丰富广大同学的业余文化生活，提高同学们的棋艺水平，增进同学们的友谊。协会现设有围棋、中国象棋、五子棋等棋类的活动与安排。所获荣誉：成功举办了 “开封市首届‘移动杯’大中小学生围棋比赛”等多次大型比赛和多次棋类知识讲座。在2001年6月还特聘河南省围棋冠军刘中杰（五段）为协会顾问。2016年成功举办第七届河南省象棋联赛。', '2018-09-19 18:09:11', null, '2', 'brief');
INSERT INTO `stchange` VALUES ('58', '00000079', '棋牌教学、河南省高校联赛               ', '2018-09-19 18:09:36', null, '2', 'jphd');
