INSERT INTO `stchange` VALUES ('61', '00000091', '1.魔术教学：每周四在综合楼，魔术社都会组织社团一起，学习易上手的魔术，保证每个社员都能有一定的收获。同时，增强社员们之间的交流。\n2.开封高校魔术比赛：河南大学魔术社每年都会和河大民生，黄河水利职业技术学院等高校联合举办魔术比赛，交流切磋魔术技法，促进魔术社发展。', '2018-09-19 19:10:42', null, '2', 'jphd');
