INSERT INTO `stchange` VALUES ('68', '00000032', '河南大学模拟联合国协会，简称河大模联（HENUMUN），2007年由外语学院付江涛老师创立，是河南大学外语学院下属的学生社团，针对全校各个院系学生开放。河南大学模拟联合国协会主要以自身学术培训和各层次模拟联合国会议和涉外性质的活动给予成员最真实的外交官体验。学生们通过亲身经历联合国会议的流程，熟悉联合国的运作方式，了解世界上的国际大事。模拟联合国的宗旨是让学生了解联合国和国际形势，展现个人能力，培养学生的团队精神，提高其综合能力。通过模拟联合国活动，学生们学习了国际政治知识，熟悉了联合国有关机构的议事规则和运作方式，提高了谈判技巧和外语表达能力，为今后走向社会、走向世界打下基础。从2010年至今，河南大学模拟联合国协会每年都积极选派队伍代表参加全国各高校的模拟联合国大会。在积极外出参加模拟联合国大会的同时，河南大学也积极筹备自己的会议，河南大学模拟联合国大会于每年四月举行。', '2018-09-19 19:47:03', '2018-09-19 20:38:37', '0', 'brief');
