INSERT INTO `stchange` VALUES ('74', '00000123', '河南大学英语协会是由河南大学学生社团联合会、河南大学校团委和河南大学大学外语教研部共同领导下的学生社团组织。本协会按照学校有关社团组织的管理规定开展活动，是以学习为目的的校级学生社团。\r社团名称（全称）：河南大学英语学习协会\r\n成立时间：2002年\r\n挂靠单位：河南大学大学外语教学部\r\n指导老师：蒋框\r\n现任负责人：王贺双\r\n社团宗旨：学习英语从兴趣开始\r\n协会精神:主动、创新、坚持、进取\n河南大学英语协会成立于2002年，是一个为广泛英语爱好者而设的年轻的学习型社团。在其“学习英语从兴趣开始”的口号下，本着“自愿、友谊、提高、进步”的精神信仰，英语协会积极组织一系列活动开拓同学的英语视野，如：唤醒一天学习激情的英语晨读活动、体验教书育人乐趣的外出支教活动、与哑巴英语say goodbye的外教交流活动等。另外，英语协会作为唯一一个隶属于河南大学大学外语教学部的学生社团，多次辅助我校外语教学部的教学活动，开展相关的英语文化讲座，旨在为学生的课余英语学习解疑答惑，构建良好的校园英语学习的互动氛围，进而推动我校学生社团文化的构筑与校园精神文明的建设。\n', '2018-09-19 21:16:39', '2018-09-20 11:19:10', '1', 'brief');
INSERT INTO `stchange` VALUES ('75', '00000123', '晨读、外教交流活动、四六级模拟考、日常支教、暑期支教', '2018-09-19 21:20:45', '2018-09-20 11:18:46', '1', 'jphd');
INSERT INTO `stchange` VALUES ('76', '00000094', '河南大学歌手俱乐部成立于2008年，挂靠于河南大学艺术学院，现有会员人数40人。该社团是一个专业性演出团体。宗旨是为每一个歌唱爱好者提供交流和自我展现的平台。活跃校园文化氛围，培养和提高同学们的音乐素质，交流飙歌经验、歌唱心得, 推广翻唱音乐，分享音乐乐趣，举行歌友交流会、专业教师辅导等活动，增进会员交流，竭力推动歌唱事业、高品位艺术的发展。歌手俱乐部为同学们提供了一个展示自己、为自己的音乐梦想而去大胆追求的一个舞台，开心快乐的唱出你我的心声。', '2018-09-19 21:21:14', '2018-09-20 11:18:52', '1', 'brief');
INSERT INTO `stchange` VALUES ('77', '00000094', '河南大学歌手俱乐部成立于2007年，挂靠于河南大学音乐学院，现有会员人数140人。该社团是一个专业性演出团体。宗旨是为每一个歌唱爱好者提供交流和自我展现的平台。活跃校园文化氛围，培养和提高同学们的音乐素质，交流飙歌经验、歌唱心得, 推广翻唱音乐，分享音乐乐趣，举行歌友交流会、专业教师辅导等活动，增进会员交流，竭力推动歌唱事业、高品位艺术的发展。歌手俱乐部为同学们提供了一个展示自己、为自己的音乐梦想而去大胆追求的一个舞台，开心快乐的唱出你我的心声。', '2018-09-19 21:21:46', '2018-09-19 22:50:35', '1', 'brief');
