INSERT INTO `stchange` VALUES ('80', '00000123', '河南大学英语协成立于2002年，是一个为广泛英语爱好者而设的年轻的学习型社团。在其“学习英语从兴趣开始”的口号下，本着“自愿、友谊、提高、进步”的精神信仰，英语协会积极组织一系列活动开拓同学的英语视野，如：唤醒一天学习激情的英语晨读活动、体验教书育人乐趣的外出支教活动、与哑巴英语say goodbye的外教交流活动等。另外，英语协会作为唯一一个隶属于河南大学大学外语教学部的学生社团，多次辅助我校外语教学部的教学活动，开展相关的英语文化讲座，旨在为学生的课余英语学习解疑答惑，构建良好的校园英语学习的互动氛围，进而推动我校学生社团文化的构筑与校园精神文明的建设。\n', '2018-09-19 21:22:58', '2018-09-20 11:18:40', '1', 'brief');
