INSERT INTO `stchange` VALUES ('82', '00000104', '3C千语时空协会成立于2003年9月，涵义\" Culture Communication Creativity\"。 协会始终坚持“文化、交流、创新”为宗旨，丰富并培养大学生的兴趣爱好。本协会属于爱心志愿者协会，会定期组织并参加一些爱心或者志愿者活动，我们会用手语舞的形式，将手语传播出去，让大家体会到手语的魅力。\n\n协会组织手语教学活动(一周两次)。参加开封爱心之家，聋哑学校等的社会志愿者活动和爱心活动。\n\n现协会部门设有：办公室、策划部、公共关系部、网络与宣传部、手语部、爱心服务小组 六个部门。\n\n', '2018-09-19 21:48:58', '2018-09-20 11:18:27', '1', 'brief');
