INSERT INTO `stchange` VALUES ('86', '00000098', 'NGU演讲表达协会创立于2014年，挂靠在河南大学音乐学院，现有会员人数65人。该社团的使命是帮助更多的大学生在众人面前自由表达思想。价值观是乐观；言行一致；永不放弃。他们注重通过一系列的演讲表达训练和实战使更多的大学生具备这项在以后的生活或就业中非常重要的能力。其品牌活动有新生杯演讲比赛、演讲特训营、五四演讲比赛等。', '2018-09-19 23:18:06', '2018-09-20 08:21:29', '1', 'brief');
INSERT INTO `stchange` VALUES ('87', '00000095', '主持人协会于2007年成立，挂靠在河南大学新闻与传播学院，现有会员二十余人。协会的主要工作是为各社团、学院以及学校各类活动提供主持人，其品牌活动有主持人大赛。从2007年创办至今，协会走出了许多优秀的主持人，他们活跃在学内、校外的各个角落，为河南大学这座古老的校园增添了亮丽的色彩、注入了新鲜的血液。协会里许多优秀的人才活跃在省级电视台，如河南八套的闻祥、马慧等。', '2018-09-20 08:36:13', '2018-09-20 11:18:16', '1', 'brief');
INSERT INTO `stchange` VALUES ('88', '00000095', '主持人协会于2007年成立，挂靠在河南大学艺术学院，现有会员二十余人。协会的主要工作是为各社团、学院以及学校各类活动提供主持人，其品牌活动有主持人大赛。从2007年创办至今，协会走出了许多优秀的主持人，他们活跃在学内、校外的各个角落，为河南大学这座古老的校园增添了亮丽的色彩、注入了新鲜的血液。协会里许多优秀的人才活跃在省级电视台，如河南八套的闻祥、马慧等。', '2018-09-20 08:43:58', '2018-09-20 11:18:06', '1', 'brief');
